function Shuna({ name, picture }) {
  return (
    <h1>
      나는 {name}를 사랑해 바로 {picture}이녀석이지
    </h1>
  );
}
const Ilike = [
  {
    name: "shuna",
    image:
      "https://www.google.com/url?sa=i&url=https%3A%2F%2F1boon.kakao.com%2Fholapet%2Fholapet1150&psig=AOvVaw1P_Xf6woFLoS5eg9OMiPUM&ust=1631352556940000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCLjfk_-L9PICFQAAAAAdAAAAABAD",
  },
  {
    name: "cat",
    image:
      "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.hankookilbo.com%2FNews%2FRead%2F201904291390027161&psig=AOvVaw2d0vxPk2ZoMxiyk5eKv9BR&ust=1631352744517000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCLCFkNmM9PICFQAAAAAdAAAAABAD",
  },
  {
    name: "totoro",
    image:
      "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.denofgeek.com%2Fmovies%2Flooking-back-at-my-neighbor-totoro%2F&psig=AOvVaw18WFVPBr5-PSx9qA7UFM9s&ust=1631352798030000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCPD3_vSM9PICFQAAAAAdAAAAABAD",
  },
];

function renderLike(Ilike) {
  console.log(Ilike);
  return <Shuna name={Ilike.name} picture={Ilike.image}></Shuna>;
}
function App() {
  return <div className="App">{Ilike.map(renderLike)}</div>;
}
export default App;
